export default function RecipeGallery({recipes}) {
    return (
    <ul>
        {recipes.map(recipe => {
         <li key = {recipe.id}>
           {recipe.title} : {recipe.ingredients}  {recipe.image}
         </li>
        })}
    </ul>
    );
}
